import React from 'react';
import SearchBar from '../SearchBar/SearchBar';
import s from '../Navbar/Nav'

export default function Nav({onSearch}) {
  //console.log(onSearch);
  return (
    <div className={s.container}>
        <SearchBar
            onSearch={onSearch}    
        />
    </div>
  )
}
